import React from "react";
import AuthenticationButton from "./components/authentication-button";
import CrystaLogo from './components/CrystaLogo.svg';

const AuthNav = () => (
  <div className = "NavContainer" class = 'bg-gradient-to-r from-blue-400 via-green-300 to-green-200 h-screen w-screen'>
    <div></div>
      <div className = "crysta-logo" class = "ml-10 -mt-14">
        <img src = {CrystaLogo} alt = "CrystaLogo" class = "content-between"/>
      </div>
      <div className="navbar-nav ml-auto">
        <AuthenticationButton />
      </div>
  </div>
);

export default AuthNav;
